import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
  Avatar,
} from "@mui/material";
import { Box } from "@mui/system";
import axios from "axios";

import React, { useEffect } from "react";
import SocialLinks from "./SocialLinks";

const ReactionChannels = () => {
  let channelData = null;
  useEffect(async () => {
    const res = await axios.get("/promoter/reactionchannel/all");
    channelData = res.data;
  }, []);

  return (
    channelData !== null &&
    channelData.map((currChannel) => (
      <div className="container">
        <Card sx={{ maxWidth: 345 }}>
          <Typography gutterBottom variant="h5" component="div">
            {currChannel.name}
          </Typography>
          <CardMedia
            component="img"
            height="140"
            image={
              require(`../../../resources/artist/images/page/${currChannel.profileImage}`)
                .default
            }
            alt="green iguana"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              Lizard
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {currChannel.originalName}
            </Typography>
          </CardContent>
          <CardActions>
            <SocialLinks linksData={currChannel.sociallinks} />
          </CardActions>
        </Card>
      </div>
    ))
  );
};

export default ReactionChannels;
